import React, { useState, useEffect } from 'react';
import AboutCard from './AboutCard';
import axios from 'axios';

const teamMembers = {
  "austin": {
    name: "Austin Nguyen",
    role: "Frontend",
    image: "aboutPageAustin.jpg",
    bio: "Junior Computer Science student at University of Texas at Austin. In my free time, I like to workout and swim."
  },
  "hudson": {
    name: "Hudson Whipple",
    role: "Frontend and Database",
    image: "aboutPageHudson.jpg",
    bio: "I’m a junior in CS at UT Austin that is fascinated by the innovation of Machine Learning, Data Science, and Software Engineering."
  },
  "christopher": {
    name: "Christopher Huelitl",
    role: "Fullstack",
    image: "aboutPageChris.jpg",
    bio: "I am a sophomore CS major at UT Austin. I like to workout, play chess, and volunteer in my free time."
  },
  "joseph arteaga": {
    name: "Joseph Arteaga",
    role: "APIs and Flask",
    image: "aboutPageJosephArteaga.jpg",
    bio: "Third year CS major at UT Austin with interest in cybersecurity and artificial intelligence."
  },
  "joseph lee": {
    name: "Joseph Lee",
    role: "Backend",
    image: "aboutPageJosephLee.jpg",
    bio: "I am a junior CS major at UT Austin. In my free time I enjoy swimming laps and watching movies."
  }
};

function About() {
  const [githubStats, setGithubStats] = useState({});
  const [totalStats, setTotalStats] = useState([0, 0]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('/about');
        setGithubStats(response.data);
        setLoading(false);
        console.log(response.data + " GitLab data");
      } catch (error) {
        console.error("Error:", error);
        setLoading(false);
      }
    };
    fetchData();
  }, []);

  useEffect(() => {
    calculateSums();
  }, [githubStats]);

  const calculateSums = () => {
    const totals = Object.values(githubStats).reduce((acc, curr) => {
      acc[0] += curr[0];
      acc[1] += curr[1];
      return acc;
    }, [0, 0]);

    setTotalStats(totals);
  };

  if (loading) {
    return <p>Loading...</p>;
  }

  return (
    <>
      <h1 className="text-align mt-5 page-title">About Us</h1>
      <div className="row g-5 m-2">
        {
          Object.entries(githubStats).map(([name, stats]) => {
            const member = teamMembers[name.toLowerCase()];
            return (
              <AboutCard
                key={name}
                name={member.name}
                role={member.role}
                image={member.image}
                bio={member.bio}
                commits={stats[0]}
                issues={stats[1]}
                tests="3"
              />
            );
          })
        }
      </div>

      <div className="row g-5 m-2 d-flex justify-content-center">
        <div className="about-custom-col">
          <div className="card about-fixed-height-group border-0 about-colors">
            <div className="card-header"><b>Group Stats & Tools</b></div>
            <div className="card-body d-flex flex-column align-items-start about-fixed-body text-start">
              <p><b>Stats:</b></p>
              <span>Total commits: {totalStats[0]}</span>
              <span>Total issues closed: {totalStats[1]}</span>
              <span>Total unit tests: 15</span>
              <span>Postman API: <a href="https://swe2024.postman.co/workspace/SWE2024~3231d72a-7b9f-433a-8568-37710e0405b5/collection/36526083-b00b3adc-0cb6-44cb-ad61-01962ea8ec6b?action=share&creator=36526083" target="_blank" rel="noreferrer">Postman Collection</a></span>
              <span>Issue Tracker: <a href="https://gitlab.com/chrisproj1/cs373-idb/-/issues" target="_blank" rel="noreferrer">Issue Tracker</a></span>
              <span>Git Repo: <a href="https://gitlab.com/chrisproj1/cs373-idb" target="_blank" rel="noreferrer">Git Repository</a></span>
              <span>Git wiki: <a href="https://gitlab.com/chrisproj1/cs373-idb/-/wikis/CheapCheapTicket?redirected_from=home" target="_blank" rel="noreferrer">Git Wiki</a></span>
              <br />
              <p><b>Tools:</b></p>
              <div className="d-flex flex-wrap flex-row">
                <a href="https://react.dev/" target="_blank" rel="noreferrer"><img className="about-tool-photo" src="/StaticImages/aboutPageReact.png" alt="react" /></a>
                <a href="https://getbootstrap.com/" target="_blank" rel="noreferrer"><img className="about-tool-photo" src="/StaticImages/aboutPageBootstrap.jpeg" alt="bootstrap" /></a>
                <a href="https://www.postman.com/" target="_blank" rel="noreferrer"><img className="about-tool-photo" src="/StaticImages/aboutPagePostman.png" alt="postman" /></a>
                <a href="https://cloud.google.com/" target="_blank" rel="noreferrer"><img className="about-tool-photo" src="/StaticImages/aboutPageGCP.png" alt="google cloud platform" /></a>
                <a href="https://flask.palletsprojects.com/en/3.0.x/" target="_blank" rel="noreferrer"><img className="about-tool-photo" src="/StaticImages/aboutPageFlask.png" alt="flask" /></a>
              </div>
              <br />
              <p><b>Data:</b></p>
              <span>Spotify API: <a href="https://developer.spotify.com/documentation/web-api" target="blank" rel="noreferrer">Spotify API</a></span>
              <span>TicketMaster API: <a href="https://developer.ticketmaster.com/products-and-docs/apis/getting-started/" target="blank" rel="noreferrer">TicketMaster API</a></span>
              <span>Collection: <a href="https://identity.getpostman.com/login?continue=https%3A%2F%2Fgo.postman.co%2Fworkspace%2FSWE2024~3231d72a-7b9f-433a-8568-37710e0405b5%2Fcollection%2F36526083-b00b3adc-0cb6-44cb-ad61-01962ea8ec6b%3Faction%3Dshare%26creator%3D36549615&intent=switch-account&target_team=swe2024" target="_blank" rel="noreferrer">Postman Collection</a></span>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default About;
